import React from "react";
import styled from "styled-components";

const HeaderContainer = styled.header`
  display: flex;
  justify-content: space-around;
  align
`;

const HeaderLinks = styled.div`
  display: flex;
  gap: 25px;
`;

export default function Header() {
  return (
    <HeaderContainer>
      <div>Logo</div>
      <div>
        <>courses</>
        <>book a lesson</>
        <>shop</>
        <>contact</>
        <>login</>
      </div>
    </HeaderContainer>
  );
}
